    -0.030661 + 0.088080 * t.OUT_0  + -0.139133 * t.OUT_1  + -0.041565 * t.OUT_2  + -0.041254 * t.OUT_3  + -0.048996 * t.OUT_4  + -0.201568 * t.OUT_5  + 0.172917 * t.OUT_6  + 0.229495 * t.OUT_7  + 0.194591 * t.OUT_8  + 0.092094 * t.OUT_9  + 0.189686 * t.OUT_10  + 0.080174 * t.OUT_11  + 0.043935 * t.OUT_12  + -0.114791 * t.OUT_13  + 0.136054 * t.OUT_14  + 0.025274 * t.OUT_15  + -0.010748 * t.OUT_16  + 0.155647 * t.OUT_17  + 0.007436 * t.OUT_18  + 0.078045 * t.OUT_19  + -0.058693 * t.OUT_20  + 0.086952 * t.OUT_21  + -0.188338 * t.OUT_22  + -0.117943 * t.OUT_23  + 0.016099 * t.OUT_24  + -0.034827 * t.OUT_25  + 0.135923 * t.OUT_26  + -0.055533 * t.OUT_27  + -0.087371 * t.OUT_28  + 0.191599 * t.OUT_29  + -0.073459 * t.OUT_30  + 0.107562 * t.OUT_31  + 0.077141 * t.OUT_32  + 0.012559 * t.OUT_33  + -0.220741 * t.OUT_34  + -0.092751 * t.OUT_35  + 0.225257 * t.OUT_36  + 0.222136 * t.OUT_37  + 0.221558 * t.OUT_38  + -0.134723 * t.OUT_39  + 0.052347 * t.OUT_40  + -0.110487 * t.OUT_41  + -0.109257 * t.OUT_42  + -0.000206 * t.OUT_43  + -0.173560 * t.OUT_44  + 0.075404 * t.OUT_45  + -0.079626 * t.OUT_46  + 0.160870 * t.OUT_47  + 0.130787 * t.OUT_48  + 0.149617 * t.OUT_49  + -0.188548 * t.OUT_50  + -0.162159 * t.OUT_51  + -0.064836 * t.OUT_52  + 0.218738 * t.OUT_53  + 0.089063 * t.OUT_54  + 0.156669 * t.OUT_55  + 0.140846 * t.OUT_56  + -0.160404 * t.OUT_57  + -0.059883 * t.OUT_58  + 0.056368 * t.OUT_59  + 0.010120 * t.OUT_60  + -0.035919 * t.OUT_61  + 0.182524 * t.OUT_62  + 0.143363 * t.OUT_63  + -0.062581 * t.OUT_64  + -0.240663 * t.OUT_65  + -0.137610 * t.OUT_66  + -0.074149 * t.OUT_67  + -0.092326 * t.OUT_68  + 0.126328 * t.OUT_69  + 0.198623 * t.OUT_70  + -0.188832 * t.OUT_71  + 0.177181 * t.OUT_72  + -0.090320 * t.OUT_73  + 0.037437 * t.OUT_74  + 0.058689 * t.OUT_75  + -0.164029 * t.OUT_76  + 0.037858 * t.OUT_77  + 0.103241 * t.OUT_78  + 0.172718 * t.OUT_79  + -0.058972 * t.OUT_80  + 0.215093 * t.OUT_81  + -0.087478 * t.OUT_82  + -0.176819 * t.OUT_83  + 0.173481 * t.OUT_84  + 0.228798 * t.OUT_85  + 0.136893 * t.OUT_86  + -0.051705 * t.OUT_87  + 0.061293 * t.OUT_88  + -0.232221 * t.OUT_89  + -0.213795 * t.OUT_90  + 0.123402 * t.OUT_91  + 0.161116 * t.OUT_92  + -0.239917 * t.OUT_93  + 0.011067 * t.OUT_94  + 0.212167 * t.OUT_95  + 0.192680 * t.OUT_96  + 0.145903 * t.OUT_97  + 0.077332 * t.OUT_98  + 0.170419 * t.OUT_99 AS OUT_0
 FROM Hidden_Layer_1_Activation AS t
)

, soft_max_orig_cte AS 
( SELECT t."index" AS "index",
    CAST(NULL AS FLOAT) AS "Proba_0", t.OUT_0 AS "Score_0", CAST(NULL AS FLOAT) AS "LogProba_0"
  FROM "Output_Layer_BA" AS t )
,
soft_max_class_union AS 
 (SELECT scu.index_u AS index_u, scu.class AS class,  scu."LogProba" AS "LogProba", scu."Proba" AS "Proba", scu."Score" AS "Score"
  FROM 
   (SELECT "index" AS index_u, 0 AS class,  "LogProba_0" AS "LogProba", "Proba_0" AS "Proba", "Score_0" AS "Score" from "soft_max_orig_cte"
    UNION ALL
    SELECT "index" AS index_u, 1 AS class,  "LogProba_1" AS "LogProba", "Proba_1" AS "Proba", "Score_1" AS "Score" from "soft_max_orig_cte"
   ) AS scu
 )
,soft_max_score_max AS 
 (SELECT t."index" AS "index",
   t."LogProba_0" AS "LogProba_0", t."Proba_0" AS "Proba_0", t."Score_0" AS "Score_0",
   t."LogProba_1" AS "LogProba_1", t."Proba_1" AS "Proba_1", t."Score_1" AS "Score_1",
   max_select."index_m" AS "index_m",
   max_select."max_Score" AS "max_Score"
  FROM
 "soft_max_orig_cte" AS t
    LEFT OUTER JOIN
    (SELECT t1.index_u AS index_m,
      max(t1."Score") AS "max_Score"
     FROM soft_max_class_union t1
     GROUP BY t1.index_u
    ) AS max_select
    ON t."index" = max_select.index_m
  )
,soft_max_deltas AS 
 (SELECT soft_max_score_max."index" AS "index",
    soft_max_score_max."Score_0" AS "Score_0",
    EXP(max(-32.0, soft_max_score_max."Score_0" - soft_max_score_max."max_Score")) AS "ExpDelta_Score_0",
    soft_max_score_max."Score_1" AS "Score_1",
    EXP(max(-32.0, soft_max_score_max."Score_1" - soft_max_score_max."max_Score")) AS "ExpDelta_Score_1",
    soft_max_score_max."max_Score" AS "max_Score"
  FROM soft_max_score_max
 )
,soft_max_class_union_with_delta AS 
 (SELECT soft_scu."index" AS "index",
   soft_scu.class AS class,
   soft_scu."ExpDelta_Score" AS "ExpDelta_Score"
  FROM (
    SELECT t."index" AS "index", 0 AS "class", t."ExpDelta_Score_0" AS "ExpDelta_Score"  FROM soft_max_deltas AS t
    UNION ALL
    SELECT t."index" AS "index", 1 AS "class", t."ExpDelta_Score_1" AS "ExpDelta_Score"  FROM soft_max_deltas AS t
) AS soft_scu)
,
soft_max_cte AS 
 (SELECT t1."index" AS "index",
    CAST(NULL AS FLOAT) AS "LogProba_0",
    t1."ExpDelta_Score_0" / sum_exp_t."sum_ExpDelta_Score" AS "Proba_0",
    t1."Score_0" AS "Score_0",
    CAST(NULL AS FLOAT) AS "LogProba_1",
    t1."ExpDelta_Score_1" / sum_exp_t."sum_ExpDelta_Score" AS "Proba_1",
    t1."Score_1" AS "Score_1"
 FROM 
   soft_max_deltas AS t1
   LEFT OUTER JOIN
   ( SELECT t3."index" AS "index",
       SUM( t3."ExpDelta_Score" ) AS "sum_ExpDelta_Score"
     FROM soft_max_class_union_with_delta AS t3
     GROUP BY t3."index"
   ) AS sum_exp_t
   ON (t1."index" = sum_exp_t."index")
 )
,
score_class_union AS 
 (SELECT scu.index_u AS index_u, scu.class AS class,  scu."LogProba" AS "LogProba", scu."Proba" AS "Proba", scu."Score" AS "Score"
  FROM 
   (SELECT "index" AS index_u, 0 AS class,  "LogProba_0" AS "LogProba", "Proba_0" AS "Proba", "Score_0" AS "Score" from "soft_max_cte"
    UNION ALL
    SELECT "index" AS index_u, 1 AS class,  "LogProba_1" AS "LogProba", "Proba_1" AS "Proba", "Score_1" AS "Score" from "soft_max_cte"
   ) AS scu
 )
,
score_max AS 
 (SELECT t."index" AS "index",
   t."LogProba_0" AS "LogProba_0", t."Proba_0" AS "Proba_0", t."Score_0" AS "Score_0",
   t."LogProba_1" AS "LogProba_1", t."Proba_1" AS "Proba_1", t."Score_1" AS "Score_1",
   max_select."index_m" AS "index_m",
   max_select."max_Score" AS "max_Score"
  FROM
    "soft_max_cte" AS t
    LEFT OUTER JOIN
    (SELECT score_class_union.index_u AS index_m,
      max(score_class_union."Score") AS "max_Score"
     FROM score_class_union
     GROUP BY score_class_union.index_u
    ) AS max_select
    ON t."index" = max_select.index_m
  )
,
union_with_max AS 
 (SELECT score_class_union.index_u AS "index",
   score_class_union.class AS class,
   score_class_union."LogProba" AS "LogProba", score_class_union."Proba" AS "Proba", score_class_union."Score" AS "Score",
   score_max."LogProba_0" AS "LogProba_0", score_max."Proba_0" AS "Proba_0", score_max."Score_0" AS "Score_0",
   score_max."LogProba_1" AS "LogProba_1", score_max."Proba_1" AS "Proba_1", score_max."Score_1" AS "Score_1",
   score_max.index_m AS index_m,
   score_max."max_Score" AS "max_Score"
  FROM
   score_class_union
   LEFT OUTER JOIN
   score_max
   ON score_class_union.index_u = score_max."index"
 )
,
arg_max_cte AS 
 (SELECT score_max."index" AS "index",
   score_max."LogProba_0" AS "LogProba_0", score_max."Proba_0" AS "Proba_0", score_max."Score_0" AS "Score_0",
   score_max."LogProba_1" AS "LogProba_1", score_max."Proba_1" AS "Proba_1", score_max."Score_1" AS "Score_1",
   score_max.index_m AS index_m,
   score_max."max_Score" AS "max_Score",
   "arg_max_t_Score"."index_Score" AS "index_Score",
   "arg_max_t_Score"."arg_max_Score" AS "arg_max_Score"
  FROM
   score_max
   LEFT OUTER JOIN
   (SELECT union_with_max."index" AS "index_Score",
     max(union_with_max.class) AS "arg_max_Score"
    FROM union_with_max
    WHERE union_with_max."max_Score" <= union_with_max."Score"
    GROUP BY union_with_max."index"
   ) AS "arg_max_t_Score"
   ON score_max."index" = "arg_max_t_Score"."index_Score"
 )
SELECT arg_max_cte."index" AS "index",
  arg_max_cte."Score_0" AS "Score_0",
  arg_max_cte."Proba_0" AS "Proba_0",
  CASE WHEN (arg_max_cte."Proba_0" IS NULL OR arg_max_cte."Proba_0" > 0.0) THEN LN( arg_max_cte."Proba_0" ) ELSE -1.79769313486231e+308 END AS "LogProba_0",
  arg_max_cte."Score_1" AS "Score_1",
  arg_max_cte."Proba_1" AS "Proba_1",
  CASE WHEN (arg_max_cte."Proba_1" IS NULL OR arg_max_cte."Proba_1" > 0.0) THEN LN( arg_max_cte."Proba_1" ) ELSE -1.79769313486231e+308 END AS "LogProba_1",
  arg_max_cte."arg_max_Score" AS "Decision",
  CASE
   WHEN (arg_max_cte."arg_max_Score" = 0) THEN arg_max_cte."Proba_0"
   WHEN (arg_max_cte."arg_max_Score" = 1) THEN arg_max_cte."Proba_1"
 END AS "DecisionProba"
FROM arg_max_cte